import React from "react";
import logo from "./images/kukra template.png"

const Header = () => {
    return(
    <>
         <div>
            <img src={logo} alt="logo" width='150px'/>
            <h1>hello ahinsa here</h1>
        </div>
    </>
    )
}

export default Header;
